class Solution(object):
    def findTheDifference(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: str
        """
        dict = {}
        for ch in s:
            if ch not in dict.keys():
                dict[ch] = 0
            dict[ch] += 1

        for ch in t:
            if ch not in dict.keys():
                return ch
            else:
                dict[ch] -= 1

        for ch in dict.keys():
            if dict[ch] != 0:
                return ch


solution = Solution()

s = "abcd"
t = "abcde"
t = "aebcd"
